    VALUES(15771, "Hilton Winnipeg Airport Suites", "1800 Wellington Avenue ", "", "Winnipeg", "MB", "R3H 1B2", 44, 49.901462, -97.20825400000001, "+1 204-783-1700", "", "", "From North: From the Perimeter Parkway, take Route 90 South - Brookside Ave and continue following the Airport symbol until you reach Wellington Ave. Take a right on Wellington and the hotel is located on the southeast corner of Wellington Ave and Berry Street.  From South: From Highway Pembina, follow to Highway 1 Portage Ave. Follow Portage West to Route 90 North to Wellington Avenue. Turn left on Wellington and the hotel is located on the southeast corner of Wellington Avenue and Berry Street.  From East: From Transcanada Highway 1, follow the Airport symbol to Highway 90 North. Turn left on Wellington Ave and the hotel is located on the southeast corner of Wellington Avenue and Berry Street.  From West: From Transcanada Highway 1 continue down Portage Avenue following the Airport signs and Highway 90 North To Wellington Avenue. Turn left on Wellington and the hotel is located on the southeast corner of Wellington and Berry Street.", "http://www3.hilton.com/en/hotels/manitoba/hilton-winnipeg-airport-suites-YWGWIHF/index.html", null);
